#include <math.h>
#include <stdbool.h>
#include <string.h>

long long maximumSum(int* nums, int numsSize) {
    long long dp[1 << 20];
    memset(dp, -1, sizeof(dp));
    dp[0] = 0; // Base case: empty set has sum 0
    int mask, i, j;
    for (i = 0; i < numsSize; ++i) {
        int factors = 0;
        for (int x = 2; x*x <= nums[i]; ++x) {
            if (nums[i] % (x*x) == 0) {
                while (nums[i] % (x*x) == 0) {
                    nums[i] /= x*x;
                }
            }
        }
        for (int x = 2; x <= nums[i]; ++x) {
            if (nums[i] % x == 0) {
                int cnt = 0;
                while (nums[i] % x == 0) {
                    nums[i] /= x;
                    cnt ^= 1;
                }
                if (cnt) factors |= 1 << (x-2);
            }
        }
        for (mask = (1 << 20) - 1; mask >= 0; --mask) {
            if (dp[mask] != -1 && (mask & factors) == 0) {
                dp[mask | factors] = fmax(dp[mask | factors], dp[mask] + nums[i]);
            }
        }
    }
    long long ans = 0;
    for (i = 0; i < (1 << 20); ++i) {
        ans = fmax(ans, dp[i]);
    }
    return ans;
}
